import React, { useState, useEffect } from "react";
import axios from "axios";
import "./HistoryPage.css";

function HistoryPage() {
  const [history, setHistory] = useState([]);
  const [loading, setLoading] = useState(false);
  const username = localStorage.getItem("username");

  useEffect(() => {
    const fetchHistory = async () => {
      setLoading(true);
      try {
        const response = await axios.get(`http://localhost:5000/api/history/${username}`);
        setHistory(response.data);
      } catch (error) {
        console.error("Error fetching history:", error);
      }
      setLoading(false);
    };

    if (username) {
      fetchHistory();
    } else {
      console.error("User not authenticated");
    }
  }, [username]);

  return (
    <div className="history-page-container">
      <h2>Diagnosis History</h2>
      {loading && <p>Loading...</p>}
      <div className="history-container">
        {history.length > 0 ? (
          history.map((item, index) => (
            <div key={index} className="history-item">
              <img src={`http://localhost:5000/${item.imagePath}`} alt="Uploaded" />
              <div>
                <h3>Diagnosis:</h3>
                <ul>
                  {item.diagnosis.map((d, i) => (
                    <li key={i}>
                      {d.label} - {(d.score * 100).toFixed(2)}%
                    </li>
                  ))}
                </ul>
                <p>
                  <strong>Date:</strong> {new Date(item.timestamp).toLocaleString()}
                </p>
              </div>
            </div>
          ))
        ) : (
          <p>No diagnosis history available.</p>
        )}
      </div>
    </div>
  );
}

export default HistoryPage;
